INSERT INTO `coaches` (`id`, `nombre_coach`, `descripcion_coach`, `id_disciplina`, `activo`, `fecha`) VALUES
(2, 'Katya', 'Hola! Soy Katya, tu coach de Barre! \nMi misión es ayudar a que más personas se reconcilien con su cuerpo, encontrando el bienestar sin reglas o restricciones. Para mi es importante crear clases donde el movimiento sea una experiencia divertida para todas las personas.', 1, 0, '2025-04-25 10:29:49'),
(3, 'Gali', 'Hola! Soy Gali, tu coach de Barre! \nMi misión es que cada clase te acerque más a tu mejor versión con alegría, amor propio y constancia. Me encanta ver a mis alumnas divertirse y disfrutar de cada momento para descubrir de lo que son capaces. Para mí el progreso no solo se mide en fuerza, sino en confianza.', 1, 1, '2025-04-25 10:29:49'),
(4, 'Regina', 'Hola!! Soy Regina, tu maestra de Vinyasa Yoga! \nVeo la unión entre mente y cuerpo como un todo. Me gusta crear a través de la meditación y el movimiento un espacio dónde se pueda conectar con el interior liberando las emociones y alineando la energía vital. ', 2, 1, '2025-04-25 10:29:49'),
(5, 'DanyFer', 'Hola! Soy DanyFer, tu coach de Barre!\nEn mis clases busco crear un espacio donde la mente y el cuerpo se alinean, donde puedas soltar barreras limitantes que te permitan fortalecer no solo tu cuerpo, sino también tu confianza y tus conexiones internas.', 1, 0, '2025-04-25 10:29:49'),
(6, 'Connie', 'Hola! Soy Connie, tu coach de Pilates!\nCreo firmemente que la práctica puede llevarte a lugares mágicos. Me gusta empoderar a las personas desde mi experiencia para que vivan con salud, sabiduría y amor.', 3, 0, '2025-04-25 10:29:49'),
(8, 'Beto', 'Hola! Soy Beto, tu coach de Sculpt!\nEn mi clases crearemos resistencia, aumentarás tu fuerza y tonificarás tu cuerpo, te esperan ejercicios funcionales con una fusión de pilates-barre y música de todo tipo que hará de tu experiencia un rato agradable.', 5, 1, '2025-04-25 10:29:49'),
(10, 'María', 'Hola! Soy María, tu maestra de Ashtanga y Rocket Yoga! \nLas clases que imparto cuentan con un enfoque de movimiento consciente, creando espacios donde las mujeres puedan reconectar con su cuerpo para llegar a un equilibrio físico, mental y espiritual.', 2, 1, '2025-04-26 13:50:08'),
(13, 'Regina', '¡Hola! Soy Regina, tu coach de Ballet Infantil.\r\nEn mis clases, me enfoco en crear un ambiente lleno de diversión y creatividad, donde las infancias puedan explorar el movimiento a través de la danza. Cultivando técnica, confianza y expresión personal. Mi objetivo es que cada clase sea un espacio seguro y alegre, donde la técnica se vaya incorporando de forma suave y natural, despertando el amor por el movimiento y el arte.\r\n', 4, 1, '2025-04-29 23:53:06'),
