INSERT INTO `disciplinas` (`id`, `nombre_disciplina`, `descripcion_disciplina`, `subdescripcion_texto1`, `subdescripcion_texto2`, `subdescripcion_texto3`, `id_coach`, `activo`, `fecha`) VALUES
(1, 'BARRE', 'La esencia del Barre nace a partir de la combinación entre Ballet y Pilates. Se trata de trabajar el cuerpo a través de movimientos pequeños, controlados y de alta repetición, con el objetivo de fortalecer, alargar y tonificar los músculos, mejorar la postura y aumentar la flexibilidad. Esta disciplina trabaja patrones de movimiento que usamos en la vida diaria, buscando mejorar la movilidad, equilibrio, estabilidad, fuerza muscular y control corporal.', 'Movilidad', 'Equilibrio', 'Control', 4, 1, '2025-04-25 10:29:11'),
(2, 'YOGA', 'El Yoga es una práctica ancestral que busca la unión entre cuerpo, mente y respiración a través del movimiento consciente. Es el arte de regresar al cuerpo y habitarlo con conciencia, de observar la mente sin juicio y de respirar con intención. Más que una disciplina física, el Yoga es una invitación a escucharte, a reconocer tus límites y a sostenerte con compasión en cada movimiento. \nA través de estilos como Ashtanga, Vinyasa y Rocket, cultivamos fuerza, flexibilidad y claridad, pero también cultivamos determinación y apertura.', 'Fluidez', 'Respiración', 'Balance', 1, 1, '2025-04-25 10:29:11'),
(3, 'PILATES', 'El enfoque principal está en fortalecer el core (zona abdominal, lumbar, pelvis y glúteos), mejorar la postura, aumentar la flexibilidad y promover una conexión mente-cuerpo. Cada ejercicio se ejecuta con precisión, fluidez y control, acompañado de una respiración consciente que potencia los resultados y calma el sistema nervioso. Se realiza únicamente con el peso del cuerpo y sobre un mat o colchoneta, sin necesidad de aparatos complejos.', 'Fuerza', 'Fluidez', 'Control', 8, 1, '2025-04-25 10:29:11'),
(4, 'BALLET', 'El Ballet Infantil es una disciplina que cultiva el cuerpo y la mente desde la base: postura, alineación, coordinación, musicalidad y conciencia corporal, es un espacio para descubrir la alegría de moverse, imaginar y crear. A través de ejercicios diseñados para su etapa de desarrollo, aprenden las posiciones básicas, exploran el ritmo, y fortalecen su equilibrio y concentración. Todo se trabaja con un enfoque lúdico y respetuoso, donde el juego convive con la estructura, y donde la técnica se va sembrando con suavidad y constancia.', 'Coordinación', 'Movimiento', 'Disciplina', 9, 1, '2025-04-25 10:29:11'),
(5, 'SCULPT', 'Sculpt es una disciplina de entrenamiento funcional que combina movimientos de fuerza, control y resistencia para moldear, definir y fortalecer el cuerpo de forma integral. Su enfoque está en trabajar con peso corporal, mancuernas ligeras, ligas de resistencia y otros elementos como pelotas o bloques, para alcanzar un entrenamiento consciente, seguro y efectivo.', 'Tonificación', 'Fuerza', 'Consciente', 7, 0, '2025-04-25 10:29:11');
